import React from 'react';
import { useTranslation } from 'react-i18next';

function Dummy() {
  const { t } = useTranslation();
  return (
    <div className='container'>
      <h1 className='dummycss'>hello {t('welcomeMessage')}</h1>
    </div>
  );
}

export default Dummy;
